// Select the navigation links
const navLinks = document.querySelectorAll('nav a');

// Add a click event listener to each link
navLinks.forEach(link => {
  link.addEventListener('click', function(event) {
    // Prevent the default behavior of following the link
    event.preventDefault();

    // Get the ID of the section to scroll to
    const targetId = this.getAttribute('href');

    // Scroll to the section with the matching ID
    const targetSection = document.querySelector(targetId);
    targetSection.scrollIntoView({ behavior: 'smooth' });
  });
});

// Select the image
const image = document.querySelector('img');

// Add a click event listener to the image
image.addEventListener('click', function() {
  // Change the image source to a different image
  this.src = 'data:image/jpeg;base64,';
});

// Select the footer element
const footer = document.querySelector('footer');

// Add a mouseover event listener to the footer
footer.addEventListener('mouseover', function() {
  // Change the footer text
  this.textContent = 'Copyright Â© 2023 My Website';
});const searchBox = document.getElementById('search-box');
const searchResults = document.getElementById('search-results');

// Listen for changes in the search box
searchBox.addEventListener('input', () => {
  // Get the search query
  const query = searchBox.value.toLowerCase();

  // Get all items to search through
  const items = document.querySelectorAll('#search-results li');

  // Filter items that match the query
  const filteredItems = Array.from(items).filter(item => {
    return item.textContent.toLowerCase().includes(query);
  });

  // Show or hide items based on filter
  filteredItems.forEach(item => {
    item.style.display = '';
  });

  items.forEach(item => {
    if (!filteredItems.includes(item)) {
      item.style.display = 'none';
    }
  });

  // Show message if no results found
  if (filteredItems.length === 0) {
    searchResults.innerHTML = '<li>No results found</li>';
  } else {
    searchResults.innerHTML = '';
  }

  // Add matching items to the search results list
  filteredItems.forEach(item => {
    searchResults.appendChild(item.cloneNode(true));
  });
});

